window.bookSummaryJSON = "<p><b>The Wilds reclaim all things. Humanity shelters within their ever-dying cities. Mages and Archons create the only path forward.</b><br> <br> While Tala is still burdened with an overly large debt, she needs to balance repayment with learning opportunities and surviving the arcanous creatures increasingly focused on her. Additionally, she must explore her newly acquired magical items, investigate a potentially lethal source of consumable power, and get back home with the caravan, trusting her defensive magics to keep her whole.<br> <br> She has found that the world is bigger than she ever imagined, and what she had thought was the peak of power is only the beginning of her journey as a Mage.</p>"; 
